const SearchForm = () => {

    const submitHandler = (e: React.FormEvent) => {
        e.preventDefault();
    }

    return (
        <form onSubmit={submitHandler}>
            <div>
                <input 
                    type={"text"}
                />
            </div>

        </form>
    );
};

export default SearchForm;
